import React, { Component } from 'react';
import kids from '../assets/PNG/INDIVIDUAL/kids.png';

class Home extends Component {
  render() {
    return (
      <div>
        <div class="container mt-5">
          <div class="row">
            <div class="col-sm">
              <img height="90" src={kids} alt="Kids Image" />
            </div>
            <div class="col-sm" />
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
